🇨🇿 První kratší sestřih @bcross_challenge z GoPro 🤛 Chtěl jsem točit víc ale pak už se nedalo vše stíhat 🤷‍♂️ Ale určitě vás čeká ještě spoustu videí na YT…

Závodit s únavovou zlomeninou na žebru, pomáhat v organizaci, točit a ještě neprošvihnout 🥭 after parties 🤸‍♂️🤣 Nebyla to sranda, ale byla to určitě nezapomenutelná akce 🤍

V rychlosti záběry od příprav, příjezdu ve čtvrtek a pak už policejních her a hlavní akce o víkendu, atmosféry a této legendární akce na střeše @igy_centrum 😍🔥 

Díky ▶️ @vm_bcross 🥭 Všem partnerům a sponzorům 🤛

